      def _encode(buff)
        val = @id
        if val != 0
          buff << 0x08

          while val != 0
            byte = val & 0x7F
            val >>= 7
            byte |= 0x80 if val > 0
            buff << byte
          end
        end

        val = @memory_start
        if val != 0
          buff << 0x10

          while val != 0
            byte = val & 0x7F
            val >>= 7
            byte |= 0x80 if val > 0
            buff << byte
          end
        end

        val = @memory_limit
        if val != 0
          buff << 0x18

          while val != 0
            byte = val & 0x7F
            val >>= 7
            byte |= 0x80 if val > 0
            buff << byte
          end
        end

        val = @file_offset
        if val != 0
          buff << 0x20

          while val != 0
            byte = val & 0x7F
            val >>= 7
            byte |= 0x80 if val > 0
            buff << byte
          end
        end

        val = @filename
        if val != 0
          buff << 0x28

          while val != 0
            byte = val & 0x7F

            val >>= 7
            # This drops the top bits,
            # Otherwise, with a signed right shift,
            # we get infinity one bits at the top
            val &= (1 << 57) - 1

            byte |= 0x80 if val != 0
            buff << byte
          end
        end

        val = @build_id
        if val != 0
          buff << 0x30

          while val != 0
            byte = val & 0x7F

            val >>= 7
            # This drops the top bits,
            # Otherwise, with a signed right shift,
            # we get infinity one bits at the top
            val &= (1 << 57) - 1

            byte |= 0x80 if val != 0
            buff << byte
          end
        end

        val = @has_functions
        if val == true
          buff << 0x38

          buff << 1
        elsif val == false
          # Default value, encode nothing
        else
          raise "bool values should be true or false"
        end

        val = @has_filenames
        if val == true
          buff << 0x40

          buff << 1
        elsif val == false
          # Default value, encode nothing
        else
          raise "bool values should be true or false"
        end

        val = @has_line_numbers
        if val == true
          buff << 0x48

          buff << 1
        elsif val == false
          # Default value, encode nothing
        else
          raise "bool values should be true or false"
        end

        val = @has_inline_frames
        if val == true
          buff << 0x50

          buff << 1
        elsif val == false
          # Default value, encode nothing
        else
          raise "bool values should be true or false"
        end
        buff << @_unknown_fields if @_unknown_fields
        buff
      end

