      def _encode(buff)
        val = @id
        if val != 0
          buff << 0x08

          while val != 0
            byte = val & 0x7F
            val >>= 7
            byte |= 0x80 if val > 0
            buff << byte
          end
        end

        val = @mapping_id
        if val != 0
          buff << 0x10

          while val != 0
            byte = val & 0x7F
            val >>= 7
            byte |= 0x80 if val > 0
            buff << byte
          end
        end

        val = @address
        if val != 0
          buff << 0x18

          while val != 0
            byte = val & 0x7F
            val >>= 7
            byte |= 0x80 if val > 0
            buff << byte
          end
        end

        list = @line
        if list.size > 0
          list.each do |item|
            val = item
            if val
              buff << 0x22

              # Save the buffer size before appending the submessage
              current_len = buff.bytesize

              # Write a single dummy byte to later store encoded length
              buff << 42 # "*"
              val._encode(buff)

              # Calculate the submessage's size
              submessage_size = buff.bytesize - current_len - 1

              # Hope the size fits in one byte
              byte = submessage_size & 0x7F
              submessage_size >>= 7
              byte |= 0x80 if submessage_size > 0
              buff.setbyte(current_len, byte)

              # If the sub message was bigger
              if submessage_size > 0
                current_len += 1

                # compute how much we need to shift
                encoded_int_len = 0
                remaining_size = submessage_size
                while remaining_size != 0
                  remaining_size >>= 7
                  encoded_int_len += 1
                end

                # Make space in the string with dummy bytes
                buff.bytesplice(current_len, 0, "*********", 0, encoded_int_len)

                # Overwrite the dummy bytes with the encoded length
                while submessage_size != 0
                  byte = submessage_size & 0x7F
                  submessage_size >>= 7
                  byte |= 0x80 if submessage_size > 0
                  buff.setbyte(current_len, byte)
                  current_len += 1
                end
              end

              buff
            end
          end
        end

        val = @is_folded
        if val == true
          buff << 0x28

          buff << 1
        elsif val == false
          # Default value, encode nothing
        else
          raise "bool values should be true or false"
        end
        buff << @_unknown_fields if @_unknown_fields
        buff
      end

      def to_h
        result = {}

        result[:"id"] = @id
        result[:"mapping_id"] = @mapping_id
        result[:"address"] = @address
        result[:"line"] = @line.map(&:to_h)
        result[:"is_folded"] = @is_folded

        result
      end

      def as_json(options = {})
        result = {}

        result["id"] = @id
        result["mappingId"] = @mapping_id
        result["address"] = @address
        tmp_line = @line.map { |v| v.as_json(options) }

        result["line"] = tmp_line if !options[:compact] || tmp_line.any?

        result["isFolded"] = @is_folded

        result
      end

      def to_json(as_json_options = {})
        require "json"
        JSON.dump(as_json(as_json_options))
      end
