        val = @id
        if val != 0
          buff << 0x08

          while val != 0
            byte = val & 0x7F
            val >>= 7
            byte |= 0x80 if val > 0
            buff << byte
          end
        end

        val = @name
        if val != 0
          buff << 0x10

          while val != 0
            byte = val & 0x7F

            val >>= 7
            # This drops the top bits,
            # Otherwise, with a signed right shift,
            # we get infinity one bits at the top
            val &= (1 << 57) - 1

            byte |= 0x80 if val != 0
            buff << byte
          end
        end

        val = @system_name
        if val != 0
          buff << 0x18

          while val != 0
            byte = val & 0x7F

            val >>= 7
            # This drops the top bits,
            # Otherwise, with a signed right shift,
            # we get infinity one bits at the top
            val &= (1 << 57) - 1

            byte |= 0x80 if val != 0
            buff << byte
          end
        end

        val = @filename
        if val != 0
          buff << 0x20

          while val != 0
            byte = val & 0x7F

            val >>= 7
            # This drops the top bits,
            # Otherwise, with a signed right shift,
            # we get infinity one bits at the top
            val &= (1 << 57) - 1

            byte |= 0x80 if val != 0
            buff << byte
          end
        end

        val = @start_line
        if val != 0
          buff << 0x28

          while val != 0
            byte = val & 0x7F

            val >>= 7
            # This drops the top bits,
            # Otherwise, with a signed right shift,
            # we get infinity one bits at the top
            val &= (1 << 57) - 1

            byte |= 0x80 if val != 0
            buff << byte
          end
        end
        buff << @_unknown_fields if @_unknown_fields
        buff
      end

      def to_h
        result = {}

        result[:"id"] = @id
        result[:"name"] = @name
        result[:"system_name"] = @system_name
        result[:"filename"] = @filename
        result[:"start_line"] = @start_line

        result
      end

      def as_json(options = {})
        result = {}

        result["id"] = @id
        result["name"] = @name
        result["systemName"] = @system_name
        result["filename"] = @filename
        result["startLine"] = @start_line

        result
      end

      def to_json(as_json_options = {})
        require "json"
        JSON.dump(as_json(as_json_options))
      end
    end
  end
end
